import React,{Component} from 'react';
//
class MainPage extends Component{

  render(){
    return(
      <div>
        <div class="row">
        <center><h3> Where are you headed next?</h3> </center>
        </div>
        <div class ="row">
        <img src="img/Travelheader.gif" />
        </div>
      </div>
    )
  }
}

export default MainPage;
